INSERT INTO `v1_46620095d306144423d35598e9fb60084bad5065c9d6eba43f98850e5c2c3976` VALUES (38214, 11, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 0.5, 0, 1, 103811, 1, 38214070, 0, 10);
